import ResponsiveTextField from '../common-comps/ResponsiveTextField';

export default class Body extends React.Component<any, any> {
    constructor(props: any) {
        super(props);
    }

    containerStyle = () => ({
        width: '100%'
    });

    render = () => {
        return (
            <div style={this.containerStyle()}>
                <PersonalInfo />
            </div>
        );
    };
}
